import React from 'react';
import reactDom from 'react-dom';
import ReactDom from 'react-dom';
import {add} from './Cal';

ReactDom.render(
    <>

    <ul>
        <li>sum of two no is {add(7,8)} </li>
        <li>sub of two no is </li>
        <li>mul of two no is </li>
        <li>div of two no is </li>
    </ul>
    </>,
    document.getElementById('root')
    );
